A unordered (missing its KO Pathway Index) list of selected Kegg Orthology Pathway Names (only the useful ones according to the data's interpreter?). The values should be an ordered list of legit KO entries, but for the sake of brevity, we model them as a multiple values of schema:value on the schema:PropertyValue since we do not currently have access to their KO entry identifiers or the patheway index values.


_:exampleKeggPathwayNames a opp:KeggPathwayNames ;
    schema:value "Nitrogen metabolism" ;
    schema:value "Two-component system" .
